import {data} from "./store/store.jsx"
import logo from './logo.svg';
import './App.css';

let newTitle = data.map((title) => (title.title));

class App extends React.Component{
  constructor (){
      super();

      this.state = {
          qty: data
      }


  }

  render() {
      console.log(this);
      let title = this.state.qty.map((title) => <div>{title.title}</div>);
      let picture = this.state.qty.map((picture) => <img srs={picture.image_main}/>);
    return (
        <div className="App">
          <header className="App-header">
              <div>{picture}</div>
              <div>{title}</div>
          </header>
        </div>
    );
  }
}


export default App;
